  let cart = [];

  function displayProducts(filter = "all") {
    const productsContainer = document.getElementById("products");
    productsContainer.style.opacity = 0; // Fade-out effect
    setTimeout(() => {
      productsContainer.innerHTML = "";
      products
        .filter(product => filter === "all" || product.category === filter)
        .forEach(product => {
          const productDiv = document.createElement("div");
          productDiv.classList.add("product");
          productDiv.innerHTML = `
            <img src="${product.image}" alt="${product.name}">
            <h3>${product.name}</h3>
            <p>Price: $${product.price}</p>
            <button class="add-to-cart" onclick="addToCart('${product.name}')">Add to Cart</button>
          `;
          productsContainer.appendChild(productDiv);
        });
      productsContainer.style.opacity = 1; // Fade-in effect
    }, 300);
  }
  
  function addToCart(productName) {
    const product = products.find(p => p.name === productName);
    cart.push(product);
    updateCart();
  
    // Animation
    const cartIcon = document.querySelector(".cart-icon");
    cartIcon.classList.add("bounce");
    setTimeout(() => cartIcon.classList.remove("bounce"), 300);
  }
  
  function updateCart() {
    const cartCount = document.getElementById("cart-count");
    const cartItems = document.getElementById("cart-items");
    const totalPrice = document.getElementById("total-price");
  
    cartCount.innerText = cart.length;
    cartItems.innerHTML = "";
    let total = 0;
    cart.forEach(item => {
      const listItem = document.createElement("li");
      listItem.innerText = `${item.name} - $${item.price}`;
      cartItems.appendChild(listItem);
      total += item.price;
    });
    totalPrice.innerText = `$${total}`;
  }
  
  // Add filter functionality
  document.querySelectorAll(".filter-btn").forEach(button => {
    button.addEventListener("click", () => {
      const category = button.getAttribute("data-category");
      displayProducts(category);
    });
  });
  
  document.querySelector(".buy-btn").addEventListener("click", () => {
    if (cart.length === 0) {
      alert("Your cart is empty. Add some items before checking out.");
    } else {
      cart = [];
      updateCart();
      document.body.classList.add("checkout-success");
      setTimeout(() => document.body.classList.remove("checkout-success"), 1000);
      alert("Thank you for your purchase!");
    }
  });
  
  // Initial Display
  displayProducts();
